function SampleWallpapers(props) {
  return (
    <div className="sample-wallpaper">
      <article className="wallpaper">
        <img src={props.imageSrc} alt="Wallpaper #1" className="wallpaper img-1" />
      </article>
    </div>
  )
}

export default SampleWallpapers
